INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('1','Assamese','Assamese is the easternmost Indo-Aryan language. It is used mainly in the state of Assam in North-East India. It is the official language of Assam. It is also spoken in parts of Arunachal Pradesh and other northeast Indian states. Nagamese, an Assamese-based Creole language is widely used in Nagaland and parts of Assam. Small pockets of Assamese speakers can be found in Bhutan.','Assamese script','LTR','as','asm','assamese_keyboard.xml','wordnet_assamese'),
 ('2','Bengali','Bengali is an eastern Indo-Aryan language. It is native to the region of eastern South Asia known as Bengal, which comprises present day Bangladesh, the Indian state of West Bengal (recently proposed to change it to new English name Paschimbanga ), and parts of the Indian states of Tripura and Assam. It is written with the Bengali script. With nearly 300 million total speakers,Bengali is one of the most spoken languages (ranking sixth in the world).','Bengali script','LTR','bn','ben','bengali_keyboard.xml','wordnet_bengali'),
 ('3','Bodo','Bodo is a language that belongs to the branch of Barish section under Baric division of the Tibeto-Burman languages and spoken by the Bodo people of north-eastern India and Nepal. The language is one of the official languages of the Indian state of Assam, and is one of the 22 scheduled languages that is given a special constitutional status in India.','Devnagari','LTR','-','brx','bodo_keyboard.xml','wordnet_bodo');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('4','Gujarati','Gujarati is an Indo-Aryan language, and part of the greater Indo-European language family. It is derived from a language called Old Gujarati (1100 - 1500 AD) which is the ancestor language of the modern Gujarati and Rajasthani languages. It is native to the Indian state of Gujarat, and is its chief language, as well as of the adjacent union territories of Daman and Diu and Dadra and Nagar Haveli.','Gujarati script','LTR','gu','guj','gujarati_keyboard.xml','wordnet_gujarati'),
 ('5','Kannada','Kannada is a language spoken in India predominantly in the state of Karnataka. Kannada, whose native speakers are called Kannadigas is one of the 40 most spoken languages in the world. It is one of the scheduled languages of India and the official and administrative language of the state of Karnataka. There are about 38 million speakers in the world.','Kannada script','LTR','kn','kan','kannada_keyboard.xml','wordnet_kannada'),
 ('6','Kashmiri','Kashmiri is a language from the Dardic sub-group and it is spoken primarily in the Kashmir Valley, in Jammu and Kashmir. There are approximately 5,554,496 speakers in Jammu and Kashmir, according to the Census of 2001.Most of the 105,000 speakers or so in Pakistan are émigrés from the Kashmir Valley after the partition of India. They include a few speakers residing in border villages in Neelum District.','Perso-Arabic script (contemporary),\r\nDevanagari script (contemporary),\r\nSharada script (ancient/liturgical)','RTL','ks','kas','kashmiri_keyboard.xml','wordnet_kashmiri');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('7','Konkani','Konkani is an Indo-Aryan language belonging to the Indo-European family of languages and is spoken on the western coast of India. It has approximately 3.6 million speakers. It is one of the official languages of India and is the official language of the Indian state of Goa. It is a minority language in Karnataka and northern Kerala.','Devanagari (official), Latin, Kannada, Malayalam and Arabic','LTR','-','kok','konkani_keyboard.xml','wordnet_konkani'),
 ('8','Malayalam','Malayalam is one of the four major Dravidian languages of Southern India. It is one of the 22 scheduled languages of India with official language status in the state of Kerala and the union territories of Lakshadweep and Pondicherry. It is spoken by 52 million people. Malayalam is also spoken in the Nilgiris district, Kanyakumari district and Coimbatore of Tamil Nadu, Dakshina Kannada, Mangalore and Kodagu districts of Karnataka. Overseas it is also used by a small population of Indian expatriates living around the globe.','Malayalam script','LTR','ml','mal','malayalam_keyboard.xml','wordnet_malayalam'),
 ('9','Manipuri','Meitei-lon or also Meitei-lol or  Manipuri  or Meithei is the predominant language and lingua franca in the southeastern Himalayan state of Manipur, in northeastern India. It is the official language in government offices. Meitei-lon is also spoken in the Indian states of Assam and Tripura, and in Bangladesh and Burma (now Myanmar).','	Devanagari (current), \r\nMeitei Mayek (historical)','LTR','-','mni','manipuri_keyboard.xml','wordnet_manipuri');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('10','Marathi','Marathi is an Indo-Aryan language spoken by the Marathi people of western and central India. There are over 68 million fluent speakers worldwide. Marathi has the fourth largest number of native speakers in India and is the fifteenth most spoken language in the world.Marathi has some of the oldest literature of all modern Indo-Aryan languages, dating from about 1000 AD. The major dialects of Marathi are called Standard Marathi and Warhadi Marathi. There are a few other sub-dialects like Ahirani, Dangi, Vadvali, Samavedi, Khandeshi, and Malwani. Standard Marathi is the official language of the State of Maharashtra.','Devanagari script (standard), Modi script (shorthand script)','LTR','mr','mar','marathi_keyboard.xml','wordnet_marathi'),
 ('11','Nepali','Nepali or Nepalese is a language in the Indo-Aryan branch of the Indo-European language family. It is the official language and de facto lingua franca of Nepal and is also spoken in Bhutan, parts of India and parts of Myanmar (Burma). In India, it is one of the country\'s 23 official languages: Nepali has official language status in the formerly independent state of Sikkim and in West Bengal\'s Darjeeling district. The influence of the Nepali language can also be seen in Bhutan and some parts of Burma. Nepali developed in proximity to a number of Tibeto-Burman languages, most notably Nepal Bhasa (Newari), and shows Tibeto-Burman influences.','Devanagari script','LTR','ne','nep','nepali_keyboard.xml','wordnet_nepali'),
 ('12','Odia','Oriya officially spelled Odia is an Indian language, belonging to the Indo-Aryan branch of the Indo-European language family. It is mainly spoken in the Indian states of Odisha (formally known as Orissa) and West Bengal. Odia is one of the many official languages in India; it is the official language of Odisha and the second official language of Jharkhand.','Odia script','LTR','or','ori','odia_keyboard.xml','wordnet_odia');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('13','Punjabi','Punjabi is an Indo-Aryan language spoken by inhabitants of the historical Punjab region (north western India and central Pakistan). For Sikhs, the Punjabi language stands as the official language in which all ceremonies take place. In Pakistan, Punjabi is the most widely spoken language. Punjabi can be subdivided into two varieties, known as Eastern Punjabi and Western Punjabi.','Gurmukhi (in India), Shahmukhi (in Pakistan)','LTR','pa','pan','punjabi_keyboard.xml','wordnet_punjabi'),
 ('14','Sanskrit','Sanskrit is a historical Indo-Aryan language and the primary liturgical language of Hinduism, Jainism and Buddhism. Today, it is listed as one of the 22 scheduled languages of India and is an official language of the state of Uttarakhand. In Indo-European studies, Sanskrit occupies a pre-eminent position along with Greek and Latin.','Written in Devanāgarī, various Brāhmī-based alphabets, and Latin script','LTR','sa','san','sanskrit_keyboard.xml','wordnet_sanskrit'),
 ('15','Tamil','Tamil is a Dravidian language spoken predominantly by Tamil people of the Indian subcontinent. It has official status in the Indian state of Tamil Nadu and in the Indian union territory of Pondicherry. Tamil is also an official language of Sri Lanka and Singapore. It is one of the 22 scheduled languages of India and declared a classical language by the government of India in 2004. Tamil is also spoken by significant minorities in Malaysia and Mauritius as well as emigrant communities around the world.','Tamil script','LTR','ta','tam','tamil_keyboard.xml','wordnet_tamil');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('16','Telugu','Telugu is a Central Dravidian language primarily spoken in the state of Andhra Pradesh, India, where it is an official language. It is also spoken in the neighbouring states of Chattisgarh, Karnataka, Maharashtra, Orissa and Tamil Nadu, and is spoken in the bordering city of Yanam, in the neighboring territory of Pondicherry. According to the 2001 Census of India, Telugu is the language with the third largest number of native speakers in India (74 million),thirteenth in the Ethnologue list of most-spoken languages worldwide,and most spoken Dravidian language. It is one of the 22 scheduled languages of the Republic of India and one of the four classical languages.','Telugu script','LTR','te','tel','telugu_keyboard.xml','wordnet_telugu'),
 ('17','Urdu','Urdu is a language that belongs to the Indo-Aryan branch of the Indo-European family. Urdu is the national language and lingua franca of Pakistan. It is also widely spoken in some regions of India, where it is one of the 22 scheduled languages and an official language of five states. Based on the Khariboli dialect of Delhi, Urdu is derived from Sanskrit and developed under the influence of Persian, Arabic, and Turkic over the course of almost 900 years. It began to take shape in what is now Uttar Pradesh, India during the Delhi Sultanate (1206–1527), and continued to develop under the Mughal Empire (1526–1858). Urdu is mutually intelligible with Standard Hindi (or Hindi-Urdu) spoken in India. Both languages share the same Indic base and are so similar in phonology and grammar that they appear to be one language.The combined population of Hindi and Urdu speakers is the fourth largest in the world.','Urdu alphabet (Nastaʿlīq script)','RTL','ur','urd','urdu_keyboard.xml','wordnet_urdu'),
 ('18','Hindi','Standard Hindi, or more precisely Modern Hindi, also known as Manak Hindi (Devanagari: मानक हिन्दी; meaning \"Standard Hindi\"), High Hindi, Nagari Hindi, and Literary Hindi, is a standardised and sanskritised register of the Hindi-Urdu language derived from the Khariboli dialect of Delhi and Western Uttar Pradesh. It is one of the official languages of the Republic of India.','Devanagari','LTR','hi','hin','hindi_keyboard.xml','wordnet_hindi');
INSERT INTO `wn_master_language` (`language_id`,`language_name`,`language_desc`,`language_script`,`language_direction`,`iso_code_char2`,`iso_code_char3`,`keyboard_xml_filename`,`database_name`) VALUES 
 ('19','English','The English language, which takes its name from its origins as the native tongue of the people of England, is today the most widely spoken language in the world. It is spoken as a first language by a majority of the inhabitants of several nations, including the United Kingdom, the United States, Canada, Australia, Ireland and New Zealand. It is the third most commonly spoken language in the world in terms of native speakers, after Mandarin Chinese and Spanish. It is widely learned as a second language and used as an official language of the European Union and many Commonwealth countries, as well as in many world organisations.','English','LTR','en','eng','english_keyboard.xml','wordnet_english');
